"""<b><h3> 5.3 LSTM (Long Short-Term Memory) Model for time series sequences</b>

* LSTMs are a special type of recurrent neural network layer designed to handle sequential data and address the vanishing gradient problem often encountered in traditional RNNs.
* LSTMs have internal "gates" (input, forget, and output gates) that regulate the flow of information, allowing them to selectively remember or forget past information, thereby maintaining a "memory" over long sequences.
* Adding an LSTM layer to our Sequential model, specifying parameters like the number of units (neurons) in the layer and whether to return sequences or just the last output.
"""

# Training LSTM models
# LSTM requires data to be in a specific 3D format: (samples, time steps, features)
# We need to create sequences for LSTM training.
def create_sequences(data, seq_length):
    X, y = [], []
    for i in range(len(data) - seq_length):
        X.append(data.iloc[i:(i + seq_length)].values)
        y.append(data.iloc[i + seq_length].values[0]) # Assuming single target column
    return np.array(X), np.array(y)

seq_length = 12 # Example: Use the past 12 time steps to predict the next

# For CO2:
# Need to use the original scaled data before dropping NaNs from lagged features for sequence creation
train_data_co2_lstm = train_data_co2_scaled.copy()
val_data_co2_lstm = val_data_co2_scaled.copy()
test_data_co2_lstm = test_data_co2_scaled.copy()

X_train_co2_lstm, y_train_co2_lstm = create_sequences(train_data_co2_lstm, seq_length)
