# Step 1 - Future Projection
n_future = 120   # number of time steps to predict (e.g., months or years depending on data)

last_window = X_test_sea_lstm[-1]  # take last window from test set
future_predictions = []

current_input = last_window.reshape(1, last_window.shape[0], last_window.shape[1])
for _ in range(n_future):
    pred = model_lstm_sea.predict(current_input, verbose=0)
    future_predictions.append(pred[0,0])

    # update input window with predicted value
    next_step = np.zeros((1,1,current_input.shape[2]))
    next_step[0,0,-1] = pred[0,0]
    current_input = np.concatenate([current_input[:,1:,:], next_step], axis=1)

# inverse scaling
future_predictions = scaler_sea.inverse_transform(np.array(future_predictions).reshape(-1,1)).ravel()

# Step 2 - Validation with available test data
y_true = scaler_sea.inverse_transform(y_test_sea_lstm.reshape(-1,1)).ravel()
y_pred = model_lstm_sea.predict(X_test_sea_lstm)
y_pred = scaler_sea.inverse_transform(y_pred.reshape(-1,1)).ravel()

mae = mean_absolute_error(y_true, y_pred)
rmse = np.sqrt(mae)
r2 = r2_score(y_true, y_pred)

print("Validation Metrics on Test Data:")
